import React from "react";
import './App.css';
import { Switch, Route } from "react-router-dom";
import Banner from "./Banner";
import Home from "./Home";

document.body.style = 'background: #8f886e;';

export default function App() {
    return (
        <div>
            <Banner/>
            <Switch>
                <Route path="/">
                    <Home />
                </Route>
            </Switch>
        </div>
    );
}
